import './index.css'
const About = () => {
    return ( 
        <div className="about">
            <h1 className="Title">
                AR - Smart Campus Navigaion Project
            </h1>
            <h2 className="h2">Creators:</h2>
            <p>Buchacho Ofir </p>
            <p>Digmi Avi </p>
        <p>Zalman Chen </p>
        <p>Sagalov Pavel </p>
        
        
    <h2 className="h2">Instructor:</h2>
        <p>Itamar Mizrahi</p>
        </div>
     );
}
 
export default About;
